import "./style.css"
//import styled from "styled-components";
function Buttons() {
  const buttons = ["+", "7", "8", "9" , "-", "4" , "5" ,"6"  , "*", "1", "2" ,"3" , "/", "0", "."];
  return(
    <div>
      {buttons.map((x) => {
        <button>{x}</button>
      })}
    </div>
  );

}
export default Buttons ;
